import { Layout, Row, Col,Divider } from "antd";
import "./style.css";

const {  Content } = Layout;

function DsNhaBan() {
  return (
    <Layout>
      <Content>
        <Row>
          <Col flex="500px">
            100px
          </Col>
          <Col flex="auto">
            Fill Rest
          </Col>
        </Row>
      </Content>
    </Layout>
  );
}

export default DsNhaBan;
